import ContactForm from "../contact-us/ContactForm";

export default function PMF_ContactUs () {
    return (
        <div>
            <p>Don't see the property you want to buy? Contact us</p>
            <div>
                <CompanyContactCard/>
                <ContactForm/>
            </div>
        </div>
    )
}
